function Apply()
{
    var packet = []; //new Array(91).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x3F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x0C;
    packet[7] = 0x0F;
    packet[8] = 0x02;
    packet[11] = 0x08;
    
    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
    device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.

}
function setDPIRazer(dpi){
    savedDpi1 = dpi;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x1F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00; 
    packet[6] = 0x07;
    packet[7] = 0x04;
    packet[8] = 0x05;
    packet[9] = 0x00;
    packet[10] = Math.floor(dpi/256);
    packet[11] = dpi%256;
    packet[12] = Math.floor(dpi/256);
    packet[13] = dpi%256;
    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
}

export function Render()
{    
    SendPacket();
    if(savedDpi1 != dpi1 && DpiControl) {
        setDPIRazer(dpi1);
    }
}


export function Shutdown()
{
    SendPacket(true);

}

export function Validate(endpoint)
{
    return endpoint.interface === 3 && endpoint.usage === 0x0001 && endpoint.usage_page === 0x000c;
}

